1397.sql:
SELECT AVG(spent) AS average_food_spending
FROM budget
WHERE category = 'Food' AND link_to_event IN (SELECT event_id FROM event WHERE status = 'Closed');

61.sql:
SELECT COUNT(*) AS NumberOfCharteredSchools
FROM schools
WHERE City = 'Hickman' AND Charter = 1 AND DOC = '52';

1148.sql:
SELECT (COUNT(CASE WHEN p.height < 180 AND pa.strength > 70 THEN 1 END) * 100.0 / COUNT(*)) AS percentage
FROM Player p
JOIN Player_Attributes pa ON p.player_api_id = pa.player_api_id;

530.sql:
-- Query to list all distinct frame styles (frameVersion)
SELECT DISTINCT frameVersion FROM cards WHERE frameVersion IS NOT NULL;

-- Query to list all cards Allen Williams worked on
SELECT * FROM cards WHERE artist = 'Allen Williams';

-- Query to find any banned cards
SELECT c.* FROM cards c JOIN legalities l ON c.uuid = l.uuid WHERE l.status = 'Banned';

731.sql:
SELECT COUNT(*) 
FROM superhero 
WHERE publisher_id = (SELECT id FROM publisher WHERE publisher_name = 'DC Comics');

287.sql:
SELECT (SUM(CASE WHEN bond_type = ' = ' THEN 1 ELSE 0 END) * 100.0 / COUNT(*)) AS percent_double_bonds
FROM bond
WHERE molecule_id = 'TR047';

1240.sql:
SELECT AVG(HCT) AS average_hematocrit_below_normal 
FROM Laboratory 
WHERE Date LIKE '1991%' AND HCT < 29;

686.sql:
SELECT COUNT(*) AS TotalPostsAboveAverageViews
FROM posts
WHERE ViewCount > (SELECT AVG(ViewCount) FROM posts);

154.sql:
SELECT COUNT(*) 
FROM client 
WHERE gender = 'M' AND district_id = (SELECT district_id FROM district WHERE A2 = 'Hl.m. Praha');

1485.sql:
SELECT 
    (SELECT Consumption FROM yearmonth WHERE CustomerID = 7 AND Date = '201304') - 
    (SELECT Consumption FROM yearmonth WHERE CustomerID = 5 AND Date = '201304') AS ConsumptionDifference;

941.sql:
SELECT SUM(points) AS total_points
FROM results
WHERE driverId = (SELECT driverId FROM drivers WHERE forename = 'Lewis' AND surname = 'Hamilton');

298.sql:
SELECT (COUNT(DISTINCT CASE WHEN m.label = '+' AND a.element = 'h' THEN m.molecule_id END) * 100.0 / COUNT(DISTINCT m.molecule_id)) AS percentage
FROM molecule m
LEFT JOIN atom a ON m.molecule_id = a.molecule_id;

562.sql:
SELECT COUNT(*) AS comment_count
FROM comments
WHERE PostId IN (SELECT Id FROM posts WHERE ViewCount = 1910);
